import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Upload from './pages/Upload';
import Dashboard from './pages/Dashboard';
import History from './pages/History';
import Visualizations from './pages/Visualizations';
import './App.css';  // Or styles.css

function App() {
  return (
    <Router>
      <div className="app">
        <nav>
          <ul className="tabs">
            <li><Link to="/pload">Upload</Link></li>
            <li><Link to="/dashboard">Dashboard (Summary)</Link></li>
            <li><Link to="/history">History</Link></li>
            <li><Link to="/visualizations">Visualizations</Link></li>
          </ul>
        </nav>
        <Switch>
          <Route path="/upload" component={Upload} />
          <Route path="/dashboard" component={Dashboard} />
          <Route path="/history" component={History} />
          <Route path="/visualizations" component={Visualizations} />
          <Route path="/" exact component={Dashboard} />  // Default to dashboard
        </Switch>
      </div>
    </Router>
  );
}

export default App;
